({ 
  logoSrc, 
  logoAlt, 
  companyName, 
  primaryCtaText, 
  primaryCtaHref,
  secondaryCtaText, 
  secondaryCtaHref 
}) => {
  const navItems = [
    { name: 'Services', href: '/services' },
    { name: 'About', href: '/about' },
    { name: 'Contact', href: '/contact' }
  ];

  const [isMobileMenuOpen, setIsMobileMenuOpen] = React.useState(false);

  return (
    <header className="w-full bg-white shadow-sm">
      <div className="container mx-auto px-4 py-4 flex items-center justify-between">
        {/* Logo */}
        <div className="flex items-center">
          <a href="/" className="flex items-center space-x-2">
            <img 
              src={logoSrc} 
              alt={logoAlt} 
              className="h-10 w-auto" 
            />
            <span className="text-xl font-semibold text-blue-600">{companyName}</span>
          </a>
        </div>

        {/* Desktop Navigation */}
        <nav className="hidden md:flex items-center space-x-6">
          {navItems.map((item) => (
            <a 
              key={item.name}
              href={item.href} 
              className="text-gray-700 hover:text-blue-600 transition-colors duration-300"
            >
              {item.name}
            </a>
          ))}
          <div className="flex space-x-4">
            <a 
              href={secondaryCtaHref} 
              className="px-4 py-2 text-blue-600 border border-blue-600 rounded-md hover:bg-blue-50 transition-colors"
            >
              {secondaryCtaText}
            </a>
            <a 
              href={primaryCtaHref} 
              className="px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700 transition-colors"
            >
              {primaryCtaText}
            </a>
          </div>
        </nav>

        {/* Mobile Menu Toggle */}
        <div className="md:hidden">
          <button 
            onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
            className="text-gray-700 focus:outline-none"
            aria-label="Toggle mobile menu"
          >
            {isMobileMenuOpen ? (
              <span className="text-2xl">×</span>
            ) : (
              <span className="text-2xl">☰</span>
            )}
          </button>
        </div>
      </div>

      {/* Mobile Menu */}
      {isMobileMenuOpen && (
        <div className="md:hidden bg-white">
          <div className="px-4 pt-2 pb-4 space-y-2">
            {navItems.map((item) => (
              <a 
                key={item.name}
                href={item.href} 
                className="block py-2 text-gray-700 hover:bg-blue-50 rounded"
              >
                {item.name}
              </a>
            ))}
            <div className="flex flex-col space-y-2 pt-2">
              <a 
                href={secondaryCtaHref} 
                className="w-full text-center py-2 text-blue-600 border border-blue-600 rounded-md"
              >
                {secondaryCtaText}
              </a>
              <a 
                href={primaryCtaHref} 
                className="w-full text-center py-2 bg-blue-600 text-white rounded-md"
              >
                {primaryCtaText}
              </a>
            </div>
          </div>
        </div>
      )}
    </header>
  );
}

({ 
