  const features = [
    {
      icon: 'mdi:glasses',
      title: feature1Title,
      description: feature1Description
    },
    {
      icon: 'mdi:timer',
      title: feature2Title, 
      description: feature2Description
    },
    {
      icon: 'mdi:star-outline',
      title: feature3Title,
      description: feature3Description
    },
    {
      icon: 'mdi:check-circle-outline',
      title: feature4Title,
      description: feature4Description
    }
