  );
}

({ 
  testimonial1Title, 
  testimonial1Description, 
  testimonial1AuthorName, 
  testimonial1AuthorRole,
  testimonial1AvatarSrc,
  testimonial2Title, 
  testimonial2Description, 
  testimonial2AuthorName, 
  testimonial2AuthorRole,
  testimonial2AvatarSrc,
  testimonial3Title, 
  testimonial3Description, 
  testimonial3AuthorName, 
  testimonial3AuthorRole,
  testimonial3AvatarSrc 
}) => {
  const testimonials = [
    {
      title: testimonial1Title,
      description: testimonial1Description,
      authorName: testimonial1AuthorName,
      authorRole: testimonial1AuthorRole,
      avatarSrc: testimonial1AvatarSrc
    },
    {
      title: testimonial2Title,
      description: testimonial2Description,
      authorName: testimonial2AuthorName,
      authorRole: testimonial2AuthorRole,
      avatarSrc: testimonial2AvatarSrc
    },
    {
      title: testimonial3Title,
      description: testimonial3Description,
      authorName: testimonial3AuthorName,
      authorRole: testimonial3AuthorRole,
      avatarSrc: testimonial3AvatarSrc
    }
  ];

  const [currentSlide, setCurrentSlide] = React.useState(0);

  const handlePrevSlide = () => {
    setCurrentSlide((prev) => (prev === 0 ? testimonials.length - 1 : prev - 1));
  };

  const handleNextSlide = () => {
    setCurrentSlide((prev) => (prev === testimonials.length - 1 ? 0 : prev + 1));
  };

  return (
    <section className="w-full py-16 bg-white dark:bg-gray-900 flex flex-col items-center">
      <div className="max-w-4xl mx-auto px-4 text-center">
        <div className="relative w-full">
          <div className="overflow-hidden relative">
            <div 
              className="flex transition-transform duration-500 ease-in-out"
              style={{ transform: `translateX(-${currentSlide * 100}%)` }}
            >
              {testimonials.map((testimonial, index) => (
                <div 
                  key={index} 
                  className="w-full flex-shrink-0 flex flex-col items-center justify-center"
                >
                  <div className="max-w-2xl text-center">
                    <h3 className="text-2xl font-semibold text-gray-800 dark:text-white mb-4">
                      {testimonial.title}
                    </h3>
                    <p className="text-lg text-gray-600 dark:text-gray-300 mb-6 italic">
                      "{testimonial.description}"
                    </p>
                    <div className="flex items-center justify-center space-x-4">
                      <img 
                        src={testimonial.avatarSrc} 
                        alt={`${testimonial.authorName}'s avatar`}
                        className="w-16 h-16 rounded-full object-cover"
                      />
                      <div>
                        <p className="text-lg font-semibold text-gray-800 dark:text-white">
                          {testimonial.authorName}
                        </p>
                        <p className="text-sm text-gray-600 dark:text-gray-400">
                          {testimonial.authorRole}
                        </p>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>

          <div className="absolute top-1/2 left-0 right-0 flex justify-between transform -translate-y-1/2">
            <button 
              onClick={handlePrevSlide}
              className="text-blue-600 hover:text-blue-800 p-2 rounded-full bg-white/80 dark:bg-gray-800/80 shadow-md"
              aria-label="Previous Testimonial"
            >
              <Icon icon="mdi:chevron-left" width={24} height={24} />
            </button>
            <button 
              onClick={handleNextSlide}
              className="text-blue-600 hover:text-blue-800 p-2 rounded-full bg-white/80 dark:bg-gray-800/80 shadow-md"
              aria-label="Next Testimonial"
            >
              <Icon icon="mdi:chevron-right" width={24} height={24} />
            </button>
          </div>

          <div className="mt-8 flex justify-center space-x-2">
            {testimonials.map((_, index) => (
              <button
                key={index}
                onClick={() => setCurrentSlide(index)}
                className={`w-3 h-3 rounded-full ${
                  currentSlide === index 
                    ? 'bg-blue-600' 
                    : 'bg-gray-300 dark:bg-gray-600'
                }`}
                aria-label={`Go to slide ${index + 1}`}
              />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
}

({ 
  stat1Title, 
  stat1Value, 
  stat2Title, 
  stat2Value, 
  stat3Title, 
  stat3Value, 
  backgroundTitle 
}) => {
  return (
    <section className="w-full bg-white dark:bg-[#1A1A2E] py-16 md:py-24 px-4 md:px-8 lg:px-16">
      <div className="max-w-7xl mx-auto">
        <div className="text-center mb-12">
          <h2 className="text-2xl md:text-3xl lg:text-4xl font-semibold text-[#0073E6] mb-4">
            {backgroundTitle || "Our Performance Impact"}
          </h2>
          <p className="text-base md:text-lg text-gray-600 dark:text-gray-300 max-w-2xl mx-auto">
            Delivering exceptional eye care with measurable results
          </p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-6 lg:gap-8">
          {[
            { title: stat1Title, value: stat1Value },
            { title: stat2Title, value: stat2Value },
            { title: stat3Title, value: stat3Value }
          ].map((stat, index) => (
            <div 
              key={index} 
              className="bg-[#F8F9FA] dark:bg-[#16213E] rounded-lg p-6 text-center transition-transform duration-300 hover:scale-[1.02] hover:shadow-md"
            >
              <div className="text-4xl md:text-5xl font-bold text-[#0073E6] mb-4">
                {stat.value || "0"}
              </div>
              <div className="text-base md:text-lg text-gray-700 dark:text-gray-200">
                {stat.title || "Unnamed Statistic"}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
